import './App.css';

const App = () => {
  const [isDarkMode, setIsDarkMode] = useState(false);

  const toggleTheme = () => {
    setIsDarkMode(!isDarkMode);
  };

  return (
    <div className={'App ' + (isDarkMode? 'dark-theme':'')} onClick={toggleTheme}>

    </div>
  );
};

export default App;
